import React, { useState } from "react";
import TopNav from "./TopNav";
import { useNavigate } from "react-router-dom";

const InventoryPage = () => {
  const navigate = useNavigate();
  const [menuOpen, setMenuOpen] = useState(false);

  return (
    <div className="bg-white min-h-screen">
      <TopNav onMenuClick={() => setMenuOpen(true)} />
      {menuOpen && (
        <>
          <div
            className="fixed inset-0 bg-black bg-opacity-40 z-40"
            onClick={() => setMenuOpen(false)}
          />
          <div className="fixed top-0 left-0 h-full w-[320px] bg-white shadow-lg z-50 p-4">
            <div className="flex items-center justify-between mb-4">
              <h2 className="text-lg font-bold">Menu</h2>
              <button
                onClick={() => setMenuOpen(false)}
                className="text-2xl font-bold"
              >
                &times;
              </button>
            </div>
            {/* <MenuBar /> or other menu component here */}
          </div>
        </>
      )}
      <div className="max-w-7xl mx-auto p-6 md:p-12">
        {/* White Tab Nav */}
        <div className="flex items-center gap-8 mb-8">
          <div
            className="flex items-center gap-2 text-teal-700 font-bold text-lg cursor-pointer"
            onClick={() => navigate("/retail-analytics")}
          >
            <span className="text-xl">üè†</span>
            <span>Home</span>
          </div>
          <div
            className="font-semibold text-base text-gray-700 hover:text-teal-700 cursor-pointer pb-1"
            onClick={() => navigate("/retail-analytics")}
          >
            Retail Analytics
          </div>
          <div className="font-semibold text-base text-teal-700 border-b-2 border-teal-700 pb-1 cursor-pointer">
            Inventory
          </div>
          <div
            className="font-semibold text-base text-gray-700 hover:text-teal-700 cursor-pointer pb-1"
            onClick={() => navigate("/catalog")}
          >
            Catalog
          </div>
        </div>

        {/* -- Your Inventory page content below this line -- */}
        {/* (Same as your code above...) */}
      </div>
    </div>
  );
};

export default InventoryPage;
